import React from 'react';
import ReactTooltip from 'react-tooltip';
import { FaHeart, FaEye } from "react-icons/fa";

const VideoBar = () => {
  let heartStyle = { color: "red", fontSize: "1.5em" };
  let eyeStyle = { color: "blue", fontSize: "1.5em" };
  return (

  <div id="videoBar">
      <button className="btn btn-secondary"
        data-tip="tooltip"
        data-place="bottom"
        data-effect="float"
        data-delay-show='1000'
        title="Add to favoutites!"> Add to favourites
        <span className="loveheart">
          <FaHeart style={heartStyle} />
        </span>
      </button>

      <button className="btn btn-primary"
        data-tip="tooltip"
        data-place="bottom"
        data-effect="float"
        data-delay-show='1000'
        title="Add to Watchlist!"> Add to Watchlist
        <span className="loveheart">
          <FaEye style={eyeStyle} />
        </span>
      </button>
      <ReactTooltip />
    </div>

)

}

export default VideoBar;
